import React, { useEffect, useState } from "react";
import "./Profile.css";

const Profile = () => {
  const [user, setUser] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchStats = async () => {
      const userId = localStorage.getItem("user_id");
      if (!userId) {
        setError("User ID not found");
        setLoading(false);
        return;
      }

      try {
        const response = await fetch(
          `http://localhost:5001/user/stats?user_id=${userId}`
        );
        if (!response.ok) throw new Error("Failed to fetch user stats");
        const data = await response.json();
        setUser(data);
      } catch (err) {
        setError(err.message);
      } finally {
        setLoading(false);
      }
    };

    fetchStats();
  }, []);

  if (loading) return <div className="dashboard">Loading...</div>;
  if (error) return <div className="dashboard">Error: {error}</div>;

  return (
    <div className="dashboard">
      <div className="card profile-section">
        <img
          src="/default-profile.png" // replace with actual image path
          alt="Profile"
          className="profile-pic"
        />
        <h3>{user.username || user.user_id}</h3>
        <p>{user.email}</p>
        <button className="save-btn">Save</button>
      </div>

      <div className="card fitness-stats">
        <h4>Fitness Stats</h4>
        <div className="stat">
          <label>Level:</label> <span>{user.level}</span>
        </div>
        <div className="stat">
          <label>XP:</label>
          <span>
            {user.xp} / {user.xpGoal}
          </span>
          <div className="progress-bar">
            <div
              className="progress-fill"
              style={{ width: `${(user.xp / user.xpGoal) * 100}%` }}
            />
          </div>
        </div>
        <div className="stat">
          <label>Score:</label> <span>{user.score}</span>
        </div>
        <div className="stat">
          <label>Exercises:</label> <span>{user.exercises}</span>
        </div>
        <div className="stat">
          <label>Reps:</label> <span>{user.reps}</span>
        </div>
        <div className="stat">
          <label>Goals:</label> <span>{user.goals}</span>
        </div>
      </div>

      <div className="card account-info">
        <h4>Account Controls</h4>
        <button className="block-btn">Block Account</button>
        <button className="unblock-btn">Unblock Account</button>
      </div>
    </div>
  );
};

export default Profile;
